    minimizer: {
      new UglifyJsPlugin({ /* your config */ })
    },
    splitChunks: {
      name: true,
      cacheGroups: {
        commons: {
          name: '_vendor',
          test: /[\\/]node_modules[\\/]/
        },
        default: {
          minChunks: 2,
          reuseExistingChunk: true
        }
      }
    },
    noEmitOnErrors: true
  }
};
```

